export default class Track {
    /** @type {number} */
    id: number;
    /** @type {number} */
    sequenceNumber: number;
    /** @type {*} */
    samples: any;
    /** @type {*} */
    droppedSamples: any;
    /** @type {number} */
    length: number;
    reset(): void;
    destroy(): void;
}
export class AudioTrack extends Track {
    /** @type {string} */
    TAG: string;
    /** @type {string} */
    type: string;
}
export class VideoTrack extends Track {
    /** @type {string} */
    TAG: string;
    /** @type {string} */
    type: string;
    /** @type {number} */
    dropped: number;
}
export class Tracks {
    audioTrack: any;
    videoTrack: any;
    destroy(): void;
}
